Uživatel musí vybavit software a funkce softwaru (mimo jiné včetně vytváření nových instancí) hardwarovou a softwarovou konfigurací požadovanou uživatelem.
Uživatelé jsou odpovědní za příslušné poplatky za používání telefonu a širokopásmového připojení, které je třeba uhradit po připojení k internetu.
Uživatel nese právní odpovědnost za chování, událost a výsledek způsobený používáním tohoto softwaru.
Jakékoli transakce a spory mezi uživateli a jinými neoprávněnými neoficiálními osobami nemají nic společného s vývojářem.
Uživatel musí dodržovat příslušné zákony a předpisy Čínské lidové republiky (pokud je uživatel uživatelem mimo Čínskou lidovou republiku, musí také dodržovat zákony a předpisy země nebo regionu, do kterého patří).
Uživatel nesmí používat software (ani některé vlastnosti a funkce softwaru) k účasti na protiprávních činech a nesmí používat příslušné procesy a služby spojené se softwarem k účasti na protiprávních činech a důsledky jakéhokoli jednání se nebudou vztahovat na vývojáře.
Uživatelé nesou svou vlastní právní odpovědnost související s obsahem informací, které zveřejňují. Uživatel nesmí vkládat, zveřejňovat ani šířit žádný z následujících obsahů softwaru, procesů a služeb souvisejících s provozem softwaru a nesmí publikovat žádný z následujících obsahů v žádné formě：

odporují základním principům stanoveným v Ústavě Čínské lidové republiky;
ohrožování národní bezpečnosti, vyzrazování státních tajemství, podvracení státní moci nebo podkopávání národní jednoty;
poškozování cti a zájmů státu;
podněcování etnické nenávisti, etnické diskriminace nebo podkopávání etnické jednoty;
podkopávání národní náboženské politiky, obhajování kultů a feudálních pověr;
šíření fám, narušování společenského řádu nebo podkopávání sociální stability;
Šíření obscénnosti, pornografie, hazardních her, násilí, vražd, teroru nebo podněcování k trestným činům;
urážet nebo pomlouvat ostatní, porušovat zákonná práva a zájmy ostatních;
Obsahuje další obsah, který Čínská lidová republika zakazuje zákony nebo správními předpisy.
Pokud to není povoleno zákonem nebo s písemným souhlasem vývojáře, uživatelé se nesmí zapojit do žádného z následujících činů：
Nezákonné nebo nevhodné použití Softwaru a Služeb;
Poškozovat normální provoz softwarového systému nebo webových stránek, záměrně šířit počítačové viry a jiné destruktivní programy;
Provádět jakékoli neobvyklé chování při používání, které může ovlivnit síťové služby softwaru (mimo jiné včetně poškození, útoku na server nebo přetížení serveru atd.);
Odstranit informace o autorských právech k softwaru a jeho kopiím.

Pokud se uživatel dopustí jakéhokoli chování, které porušuje zákony a předpisy nebo porušuje ustanovení této smlouvy, má vývojář právo přijmout opatření proti uživateli podle závažnosti situace v souladu s touto smlouvou a zákony a předpisy, mimo jiné včetně ukončení služeb. Pokud nastanou závažné okolnosti, budou předány příslušným správním orgánům ke správnímu potrestání nebo prošetřeny pro trestní odpovědnost.

Pokud souhlasíte s těmito Podmínkami použití a používáte online služby Softwaru, budeme shromažďovat následující informace：
IP adresa zařízení, na kterém je Software spuštěn (což nemusí být správná adresa);
Některé systémové informace o zařízení, na kterém Software pracuje;
Pokud dojde k chybě softwaru, mohou být se souhlasem uživatele odeslány protokoly softwaru spuštěného v systému (včetně některých systémových informací), které pomohou vyřešit problém a vylepšit software.
Další informace, které budou nahrány se souhlasem uživatele (jak je uvedeno v softwaru).

1. Pozastavení a ukončení Služby Uživatele

Pokud uživatel zveřejní nezákonné informace, závažným způsobem porušuje společenskou morálku nebo zákazy zákona, vývojář ukončí poskytování služeb uživateli;
Pokud se uživatel při převzetí softwarové služby dopustí nesprávného jednání, má vývojář právo ukončit službu poskytovanou uživateli (konkrétní okolnosti nesprávného jednání jsou jasně stanoveny v této smlouvě);
Pokud uživatel používá upravenou verzi softwaru od třetí strany, nese uživatel své vlastní riziko a právní odpovědnost.

2. Pozastavení, pozastavení a ukončení softwaru a služeb：

V případě kterékoli z následujících okolností má vývojář právo ukončit nebo přerušit všechny nebo část služeb softwaru a vývojář nenese odpovědnost vůči uživateli ani žádné třetí straně za nepříjemnosti nebo škody tím způsobené：

a. v souladu se Softwarem a Službami;
b. Nesprávnou funkcí v důsledku poškození serveru;
c. V důsledku náhlého selhání softwarového a hardwarového vybavení a elektronických komunikačních zařízení;
d. v důsledku poruch linky poskytovatele sítě nebo jiných poruch;
e. z politických důvodů;
f. Důvody třetích stran nebo jiné okolnosti vyšší moci.

Vývojář si vyhrazuje právo ukončit nebo částečně ukončit Software a Služby, pokud to považuje za nutné, a Vývojář může informovat Uživatele formou oznámení, ale Vývojář nenese odpovědnost za žádné ztráty způsobené Uživateli.

Tato Smlouva se řídí právem Čínské lidové republiky, bez ohledu na všechna ustanovení o kolizi právních norem;
Pokud vývojář neuplatní, neuplatní včas nebo plně neuplatní práva vyplývající z této smlouvy nebo v souladu se zákonem, nebude to považováno za zřeknutí se výkonu těchto práv, ani to nebude mít vliv na výkon těchto práv vývojářem v budoucnu;
V rozsahu povoleném zákonem má Vývojář právo vykládat podmínky této Smlouvy;
Uživatelé si mohou stěžovat a hlásit všechny druhy porušení zákonů a předpisů e-mailem, zašlete prosím e-mail na adresu services@mcsl.com.cn.
